- input: '"TEXT","F3XA",,"Re: FEC letter dated 2/6/04. We apologize for the fact that
    the response is late. The letter was lost in our mailroom and was just discovered
    today. We have also contacted the FEC and spoken with Christopher Morse and  explained
    the situation to him. The Schedule A receipts are from an annual joint fundraising
    event. The joint fundraising committee''s receipts were less than the expenditures
    it had to make for 2003. As a result, no money was disbursed from the joint fundraising
    committee to the joint fundraiser participants."'
